import React from 'react'

function Nav() {
    return (
        <div className="nav">
            <img className ="nav_logo"  src ="https://upload.wikimedia.org/wikipedia/commons/thumb/1/15/Logonfx.png/1199px-Logonfx.png" alt="Netflix Logo"
            />
        </div>
    )
}

export default Nav
